import React, { useState, useEffect } from 'react';
import Timer from './Timer';
function CleanUp(){
    const [showTimer, setShowTimer] = useState(false);
    return(
        <div>
            <Timer />
            <button>Toggle Timer</button>
        </div>
    )
}

export default CleanUp;
